func (s *FinancialStatementSmartContract) updateFinancialStatement(APIstub shim.ChaincodeStubInterface, args []string) sc.Response {

	if len(args) != 12 {
		return shim.Error("Incorrect number of arguments. Expecting 12")
	}

	statementAsBytes, _ := APIstub.GetState(args[0])

	if statementAsBytes == nil {
		return shim.Error("This statement does not exist in the state database")
	}

	statement := FinancialStatement{}
	json.Unmarshal(statementAsBytes, &statement)

	statement.AuditorOption = args[1]
	statement.TotalDebt = args[2]
	statement.ShortTermDebt = args[3]
	statement.LongTermDebt = args[4]
	statement.InitialCapital = args[5]
	statement.TotalAsset = args[6]
	statement.ProofImage = args[7]
	statement.CreateAt = args[8]
	statement.LastCreateAt = args[9]
	statement.Quarter = args[10]
	statement.Year = args[11]

	statementAsBytes, _ = json.Marshal(statement)
	APIstub.PutState(args[0], statementAsBytes)

	return shim.Success(nil)

}

func (s *FinancialStatementSmartContract) deleteFinancialStatement(APIstub shim.ChaincodeStubInterface, args []string) sc.Response {

	if len(args) != 1 {
		return shim.Error("Incorrect number of arguments. Expecting 2")
	}

	APIstub.DelState(args[0])

	return shim.Success(nil)

}
